import React from 'react';
import Logo from './images/s3wd.png'
import { Link, NavLink } from 'react-router-dom';

const Nav_Bar = () => {
    return (
        <>
            <header>
                    <Link className="" to="/"><img src={Logo} alt="s3wd Logo"/></Link>
                    <div className="" id="">
                        <ul className="">
                            <li className=""><NavLink className="nav-link" to="/">Home</NavLink></li>
                        </ul>
                     </div>
            </header>
        </>
    );
};

export default Nav_Bar;
